static uni16_t *cur_uni16 = NULL;

/*
 * Translate a single DBCS EBCDIC character to Unicode.
 *
 * If EUO_BLANK_UNDEF is set, undisplayable characters are returned as
 *  wide spaces (U+3000); otherwise they are returned as 0.
 */
ucs4_t
ebcdic_dbcs_to_unicode(ebc_t c, unsigned flags)
{
    	int row, col;
	int ix;

	if (cur_uni16 == NULL || c < 0x100)
	    	return (flags & EUO_BLANK_UNDEF)? 0x3000: 0;

	if (c == 0x4040)
		return 0x3000;

	row = (c >> 7) & 0x1ff;
	if (cur_uni16->ebc2u[row] == NULL)
	    	return (flags & EUO_BLANK_UNDEF)? 0x3000: 0;
	col = (c & 0x7f) * 2;
	ix = ((cur_uni16->ebc2u[row][col] & 0xff) << 8) |
	      (cur_uni16->ebc2u[row][col + 1] & 0xff);
	if (ix)
	    	return ix;
	else
	    	return (flags & EUO_BLANK_UNDEF)? 0x3000: 0;
}

/*
 * Map a UCS-4 character to a DBCS EBCDIC character.
 * Returns 0 for failure, nonzero for success.
 */
ebc_t
unicode_to_ebcdic_dbcs(ucs4_t u)
{
    	int row, col;
	int ix;

	if (cur_uni16 == NULL || !u)
		return 0;
	if (u == 0x3000)
		return 0x4040;

	row = (u >> 7) & 0x1ff;
	if (cur_uni16->u2ebc[row] == NULL)
	    	return 0;
	col = (u & 0x7f) * 2;
	ix = ((cur_uni16->u2ebc[row][col] & 0xff) << 8) |
	      (cur_uni16->u2ebc[row][col + 1] & 0xff);
	return ix;
}

/*
 * Set the EBCDIC-to-Unicode DBCS translation table.
 * Returns true for success, false for failure.
 */
bool
set_uni_dbcs(const char *cpname, const char **codepage)
{
    int i;
    const char *realname = cpname;
    bool rc = false;

    /*
     * Check for an all-numeric name. There are no names or aliases that are
     * just numbers, so adding a 'cp' to the front of an all-numeric name will
     * not cause any misidentification.
     */
    if (is_all_digits(realname)) {
	realname = txAsprintf("cp%s", realname);
    }

    /* Search for an alias. */
    for (i = 0; cpaliases16[i].alias != NULL; i++) {
	if (!strcasecmp(realname, cpaliases16[i].alias)) {
	    realname = cpaliases16[i].canon;
	    break;
	}
    }

    /* Search for a match. */
    for (i = 0; uni16[i].name != NULL; i++) {
	if (!strcasecmp(realname, uni16[i].name)) {
	    cur_uni16 = &uni16[i];
	    *codepage = uni16[i].codepage;
	    rc = true;
	    break;
	}
    }

    /*
     * If this fails (which we sometimes do on purpose), forget any
     * old setting.
     */
    if (!rc) {
	cur_uni16 = NULL;
    }

    return rc;
}
